import React from 'react';
import technoList from '../../utils/technoList';

function Banner() {
  const techno = technoList.map((item) => (
    <li key={item.index} className="techno-item">
      <img src={item.imageUrl} alt={item.imageAlt} />
    </li>
  ));
  return (
    <div>
      <h2>Technologies</h2>
      {techno}
    </div>
  );
}

export default Banner;
